        super(props);
        this.setCurrent = this.setCurrent.bind(this);
    }

    setCurrent(event){
        this.props.handleButton(parseInt(event.target.name));
    }
    
    render() {
        return (
            <div className="div_options">
                <div className="btn-group-vertical">
